import React from "react";

function Skills(props) {
  const PersonSkills = props.skills.map((skill, index) => <li>{skill}</li>);
  return (
    <div>
      <h3>Skills</h3>
      <ul>{PersonSkills}</ul>
    </div>
  );
}

export default Skills;
